import React, { Component } from 'react';
import { BrowserRouter, Link, Route, Switch, Redirect } from 'react-router-dom';
import Home from './components/Home';
import Secret from './components/Secret';
import Login from './components/Login';
import Register from './components/Register';
import withAuth from './components/withAuth';
import LogOut from './components/LogOut';


export default class App extends Component {

  render() {
      return (

        <BrowserRouter>
                <nav class="navbar navbar-expand-lg navbar-dark bg-primary">
          <a class="navbar-brand" href="#">Navbar</a>
          <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarColor01" aria-controls="navbarColor01" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
          </button>

          <div class="collapse navbar-collapse" id="navbarColor01">
            <ul class="navbar-nav mr-auto">
              <li class="nav-item active">
                <a class="nav-link" href="#"><Link to="/">Home</Link><span class="sr-only">(current)</span></a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="#"><Link to="/login">Login</Link></a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="#"><Link to="/register">Register</Link></a>
              </li>
            </ul>
            <Switch>
              <Route path="/" exact component={Home} />
              <Route path="/login" component={Login} />
              <Route path="/register" component={Register} />
              <Route path="/secret" component={withAuth(Secret)} />
              <Route path="/logout" component={withAuth(LogOut)} />
            </Switch>
          </div>
        </nav>
        </BrowserRouter>
      );
  }
}
